import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const AdminPanel = () => {
  const [bookings, setBookings] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    axios.get('/api/bookings', { params: { role: 'admin' } }).then(res => {
      if (res.data.success) {
        setBookings(res.data.bookings);
      }
    });
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('userId');
    localStorage.removeItem('username');
    navigate('/');
  };

  return (
    <div style={styles.pageContainer}>
      <div style={styles.panelContainer}>
        <button onClick={handleLogout} style={styles.logoutButton}>
          Logout
        </button>
        <h1 style={styles.heading}>🚂 Admin Dashboard - Bookings Overview</h1>
        <div style={styles.tableContainer}>
          <table style={styles.table}>
            <thead>
              <tr>
                {['Booking ID', 'Username', 'Seat Name', 'Train Name', 'Time Slot', 'Booking Date', 'Source City', 'Destination City'].map((header, index) => (
                  <th key={index} style={styles.th}>{header}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {bookings.map(booking => (
                <tr
                  key={booking.id}
                  style={styles.tr}
                  onMouseEnter={e => e.currentTarget.style.backgroundColor = '#f9f9ff'}
                  onMouseLeave={e => e.currentTarget.style.backgroundColor = '#fff'}
                >
                  <td style={styles.td}>{booking.id}</td>
                  <td style={styles.td}>{booking.username}</td>
                  <td style={styles.td}>{booking.seat_name}</td>
                  <td style={styles.td}>{booking.train_name}</td>
                  <td style={styles.td}>{booking.time_slot}</td>
                  <td style={styles.td}>{new Date(booking.booking_date).toLocaleDateString('en-GB')}</td>
                  <td style={styles.td}>{booking.source_city_name}</td>
                  <td style={styles.td}>{booking.destination_city_name}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

// Upgraded Internal Styles
const styles = {
  pageContainer: {
    minHeight: '100vh',
    background: 'linear-gradient(to right, #0f2027, #203a43, #2c5364)',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    padding: '40px 20px',
    fontFamily: `'Poppins', sans-serif`,
  },
  panelContainer: {
    backgroundColor: '#ffffff',
    padding: '40px',
    borderRadius: '16px',
    boxShadow: '0 12px 24px rgba(0,0,0,0.2)',
    width: '100%',
    maxWidth: '1200px',
    position: 'relative',
    animation: 'fadeInUp 0.7s ease forwards',
  },
  heading: {
    textAlign: 'center',
    marginBottom: '30px',
    color: '#333',
    fontSize: '32px',
    fontWeight: '600',
  },
  logoutButton: {
    position: 'absolute',
    top: '20px',
    right: '30px',
    padding: '12px 20px',
    backgroundColor: '#ff4b5c',
    color: 'white',
    border: 'none',
    borderRadius: '30px',
    fontSize: '14px',
    fontWeight: 'bold',
    cursor: 'pointer',
    boxShadow: '0 4px 10px rgba(255, 75, 92, 0.3)',
    transition: 'all 0.3s ease',
  },
  tableContainer: {
    overflowX: 'auto',
    borderRadius: '10px',
  },
  table: {
    width: '100%',
    borderCollapse: 'separate',
    borderSpacing: '0',
    backgroundColor: '#ffffff',
  },
  th: {
    backgroundColor: '#4a69bd',
    color: 'white',
    textAlign: 'center',
    padding: '16px',
    fontSize: '16px',
    letterSpacing: '1px',
    position: 'sticky',
    top: '0',
    zIndex: '2',
  },
  tr: {
    transition: 'background-color 0.3s ease',
  },
  td: {
    padding: '14px 16px',
    borderBottom: '1px solid #f1f1f1',
    textAlign: 'center',
    fontSize: '15px',
    color: '#555',
  },
};

// Add keyframe animation manually
const styleSheet = document.styleSheets[0];
const keyframes =
  `@keyframes fadeInUp {
    from {
      opacity: 0;
      transform: translateY(40px);
    }
    to {
      opacity: 1;
      transform: translateY(0);
    }
  }`;
styleSheet.insertRule(keyframes, styleSheet.cssRules.length);

export default AdminPanel;
